import "./App.css";
import { AboutUs } from "./modules/about/about-us";
import { Footer } from "./modules/footers/footer";
import { Hero } from "./modules/heros/hero";
import { Navbar } from "./modules/navbar/nav";
import { Offices } from "./modules/offices/office";
import { Services } from "./modules/servis/services";
import { ShippingCalculator } from "./modules/shipping-calculator/calculator";
import { SimpleSteps } from "./modules/simple-steps/simple";
import { SocialMedia } from "./modules/social/social-media";
import { Tracking } from "./modules/tracking/trackings";

function App() {
  return (
    <div className="App">
      <Navbar />
      <section id="quiénes-somos" className="py-20">
        {" "}
        {/* Sección 1 */}
        <h2>Quiénes Somos</h2>
        {/* Contenido */}
      </section>

      <section id="servicios" className="py-20">
        {" "}
        {/* Sección 2 */}
        <h2>Servicios</h2>
        {/* Contenido */}
      </section>

      <section id="calculadora" className="py-20">
        {" "}
        {/* Sección 3 */}
        <h2>Calculadora</h2>
        {/* Contenido */}
      </section>

      <section id="seguimiento" className="py-20">
        {" "}
        {/* Sección 4 */}
        <h2>Seguimiento</h2>
        {/* Contenido */}
      </section>

      <section id="oficinas" className="py-20">
        {" "}
        {/* Sección 5 */}
        <h2>Oficinas</h2>
        {/* Contenido */}
      </section>
      <Navbar />
      <Hero />
      <AboutUs />
      <Services />
      <Tracking />
      <SimpleSteps />
      <ShippingCalculator />
      <Offices />
      <SocialMedia />
      <Footer />
    </div>
  );
}

export default App;
